function Tache({sendInfo}) {

    return <div className="Tache">
        <div className="Home">
            <p>
                <FontAwesomeIcon icon={faUser} />
                Accueil
            </p>
        </div>
        <div className="Profil">
            <i class="fa-solid fa-user"></i>
        </div>
    </div>;
}
export default Tache;
